  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import { Playground, PropsTable } from 'docz'
import Dropdown from './Dropdown'
import NormalDropdownExample from './NormalDropdownExample'
import MultiSelectDropdownExample from './MultiSelectDropdownExample'

export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}>
<MDXTag name="h1" components={components} props={{"id":"dropdown"}}>{`Dropdown`}</MDXTag>
<MDXTag name="p" components={components}>{`Dropdown is a controlled component. In other words, it doesn't hold the state
of the currently selected item or items in the dropdown list, delegating this
responsability to another React component. The examples below show how to use a
parent component to control the dropdown state.`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"single-select-dropdown"}}>{`Single select dropdown`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-js","metastring":null}}>{`class NormalDropdownExample extends React.Component {
  state = { value: null }

  handleChange = value => {
    this.setState({ value })
  }

  render() {
    const items = [
      { value: 'Harry Potter', id: 1 },
      { value: 'A Song of Ice and Fire', id: 2 },
      { value: 'The Lord of the Rings', id: 3 },
      { value: 'The Wheel of Time', id: 4 },
      { value: 'The Kingkiller Chronicle', id: 5 },
      { value: 'The Dark Tower', id: 6 },
      { value: 'Mistborn', id: 7 },
      { value: 'The Discworld', id: 8 },
    ]

    return (
      <Dropdown
        items={items}
        name="Best Fantasy Series"
        placeholder="Selecione"
        selected={this.state.value}
        onChange={this.handleChange}
      />
    )
  }
