<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-js","metastring":null}}>{`class MultiSelectDropdownExample extends React.Component {
  state = { values: [1, 3] }

  handleChange = values => {
    this.setState({ values })
  }

  render() {
    const items = [
      { value: 'The Legend of Zelda', id: 1 },
      { value: 'Castlevania', id: 2 },
      { value: 'Metal Gear Solid', id: 3 },
      { value: 'Metroid', id: 4 },
      { value: 'SimCity', id: 5 },
      { value: 'Street Fighter', id: 6 },
      { value: 'Mortal Kombat', id: 7 },
      { value: 'Super Mario Bros.', id: 8 },
      { value: 'Megaman', id: 9 },
      { value: 'Diablo', id: 10 },
      { value: 'Age of Empires', id: 11 },
      { value: 'Doom', id: 12 },
    ]

    return (
      <Dropdown
        items={items}
        name="Classic Games"
        placeholder="Selecione"
        selected={this.state.values}
        onChange={this.handleChange}
        multiselect
        buttonLabel={{ singular: 'game', plural: 'games' }}
      />
    )
  }
}
